import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and type query
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.type('#searchInput', 'iPhone', { delay: 100 });

    // Wait for autocomplete suggestions to appear
    await page.waitForSelector('.search-suggestions', { timeout: 5000 });
    await page.waitForSelector('.suggestion-item', { timeout: 5000 });

    // Take screenshot of autocomplete dropdown
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_autocomplete.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_autocomplete.png'));

    // Extract autocomplete suggestions
    const suggestions = await page.$$eval('.suggestion-item', 
      items => items.map(item => item.textContent.trim())
    );

    // Verify autocomplete functionality
    const hasSuggestions = suggestions.length > 0;
    const containsRelevant = suggestions.some(s => 
      s.toLowerCase().includes('iphone') || 
      s.toLowerCase().includes('electronics')
    );

    return {
      success: true,
      action: "Tested search autocomplete functionality by typing 'iPhone' and capturing suggestions",
      extractedData: {
        suggestions,
        hasSuggestions,
        containsRelevant
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test search autocomplete functionality",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
